    { id: 3, title: 'Puthon 3', body: 'Description' },  /*передаем массив */

  ])


  return (
    <div className="App">
      <PostList posts={posts} title = "список постов 1"/>    {/* передаем PostList и массив что в пропсах posts и title */}
      <PostList posts={posts2} title = "список постов 2"/>    {/* передаем PostList и массив что в пропсах posts и title */}

    </div>
  );
}

export default App;
